@evanlinjin hm, as I can see, we still need some kind of flag indicating that the server is done. If we do as you suggested, than `close` will return `true` only once, when it is called for the first time. But the first time it's intented to be called from `Close`. This way when we get an error from the listener and call `close`, it will be the second call which will result in `false`, thus returning the unwanted error from `Serve`. Probably we should have the bool being returned from `close` as a field in the `Server` struct, so it will give us the same value each time `close` is called. But it will ruin the thought you put into this `close`. What if we do it the following way. Let's say, we have this:
```
type Server struct {
    closeInitiated int32
    done int32
}
```

Then the `Close` will be:
```
func (s *Server) Close() (err error) {
        if atomic.LoadInt32(&s.done) == 1 {
                return erros.New("server is already closed")
        }

        if !atomic.CompareAndSwapInt32(&s.closeInitiated, 0, 1) {
                return errors.New("server is already being closed")
        }

	if err := s.lis.Close(); err != nil {
                atomic.Store(&s.done, 1)
                atomic.Store(&s.closeInitiated, 0)
		return err
	}

        atomic.Store(&s.done, 1)
        atomic.Store(&s.closeInitiated, 0)

        s.mx.Lock()
	s.conns = make(map[cipher.PubKey]*ServerConn)
        s.mx.Unlock()

	s.wg.Wait()
	return nil
}
```

Then we may have both `IsBeingClosed` and `IsClosed` like this:
```
func (s *Server) IsBeingClosed () bool {
        return atomic.LoadInt32(&s.closeInitiated) == 1
}

func (s *Server) IsClosed() bool {
        return atomic.LoadInt32(&s.done) == 1
}
```

And `Serve` will be like:
```
rawConn, err := s.lis.Accept()
if err != nil {
	if s.IsBeingClosed() || s.IsClosed() {
		return nil
	}
	
        return err
}
```

Personally, I don't like the idea of addig a lot of funcs which may not ever be needed (e.g. `IsBeingClosed`). What do you think if we won't try to represent the state of the whole server? We actually don't have such a need, I added this func only to filter out the socket error. What if we just add the `socketIsClosed bool` field to a server and set it to `true` via the `sync.Once` in `Close`? And we may totally remove `IsClosed` in this case and leave it's implementation a subject for future discussions if it ever gets really needed

