I don't think I agree with that ;) At least not if we don't add additional checks with respect to the constraints. If a package ```py-foo``` is happy with whatever version of ```py-bar```, then even if there is a newer version of ```py-bar``` available upstream we should not generate a new Portfile (or probably even update it unconditionally once that feature is available). There might be valid reason for keeping ```py-bar``` at a lower version because of requirements of other packages for example.

So I think we should check whether the available package would fulfill the ```constraints``` and if that's the case we just log "FYI: there is a newer version available upstream" but don't do anything else. If the version is too low then we should certainly log that and only in that case we could consider to return ```True```. But even there I would be in favor of not doing that right now as this would only work properly anyway once the "update" feature is in place. 

