The complexity of this algorithm is quadratic in the worst case. I think we can do better here. We could serialize the document to `Vec<(u64, String)>` in one pass of `visit_nested_tables`. Each entry of this vec would represent a table. The `u64` will be an id of the table sorted as in the final `String`, and the second part of the tuple is the `String` representation of the table. Then all we need to do is to sort the vec by id and concatenate the strings.

How do we construct this vec? Something like this:
```rust
       // this number should be at least the number of tables with position `None`
       // alternatively, this could be computed in one pass of `visit_nested_tables`
       const MULTIPLIER: usize = 100500;
       // this would account for all `None` positions
       let mut increment = 0;
       let mut last_position = 0;
       let mut tables = Vec::new();
       self.visit_nested_tables(path, is_array_of_tables, &mut |t, p, is_array| {
            if let Some(pos) = t.position {
                last_position = pos;
                increment = 0;
            } else {
                increment += 1;
            }
            let id = last_position * MULTIPLIER + increment;
            let mut s = String::new();
            visit_table(&mut s, t, p, is_array);
            tables.push((id, s));
            Ok(())
        })?;
        tables.sort_by_key(|&(id, _)| id);
```
